import React from 'react';
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types';

const OwnerItem = ({ profile: { user } }) => {
  if (user) {
    name = user.name;
  }
  return (
    <div className='profile bg-light'>
      <img src='' alt='ni arae' className='round-img' />
      <div>
        <h2>{'name'}</h2>
        <p>
          {'email'} {'address' && <span> at {'address'}</span>}{' '}
        </p>
        <p className='my-1'> {'cellPhone' && <span>{'cellPhone'}</span>} </p>
        {/* <link to={`/profile`} className='btn-btn-primary'>
          View Profile
        </link> */}
      </div>
    </div>
  );
};

OwnerItem.propTypes = {
  profile: PropTypes.object.isRequired
};

export default OwnerItem;
